import React, { Component } from 'react'
import ComponentB from './ComponentB'
import { UserProvider } from './Contexts'

class ComponentA extends Component {
  render() {
    return (
      <div>
        <UserProvider value='ABC'>
            <ComponentB/>
        </UserProvider>
      </div>
    )
  }
}

export default ComponentA
